import React from "react";
import ContactMeForm from "../Contact/contactMeForm";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  MDBFooter,
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBIcon,
  MDBBtn,
} from "mdb-react-ui-kit";

export default function FooterAndContact() {
  return (
    <MDBFooter
      className="text-center text-white"
      style={{ backgroundColor: "red", display: "flex" }}
    >
      <MDBContainer className="pt-4">
        <section style={{ justifyContent: "center" }}>
          <h1 style={{ color: "black" }}>Contact Me</h1>

          <ContactMeForm></ContactMeForm>

          <FontAwesomeIcon icon="fa-regular fa-file-user" /> 
                 </section>
      </MDBContainer>
    </MDBFooter>
  );
}
